import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Shaka Clark</h1>
        <p>Social Justice Oriented Software Engineer</p>
        <hr />
        <p>Software Engineer</p>
      </header>
    </div>
  );
}

export default App;
